## 数据可视化 Dashboard

实时数据展示与图表分析，支持多数据源接入。

### 特性

- **Chart.js** 图表
- **WebSocket** 实时推送
- **Node.js** 后端 API

### 示例代码

```javascript
const chart = new Chart(ctx, {
  type: 'line',
  data: { labels, datasets }
});
```

